export default function Username() {

  const formik=useFormik({
       initialValues:
       {
         username:''
       }, 


  })

  console.log( formik.values);
  return (
    <div>
      <div className="row justify-content-center">
        <h3 className="col-2 ">Hello Again</h3>
      </div>
      <div className="row justify-content-center">
        <p className="col-2.5">Explore more by connecting with us</p>
      </div>

      <div className="row justify-content-center ">
      <div class="col-md-2-sm-1  px-0">
        <img style={{height:200}}
          className="img-responsive "
          src={avatar}
          alt="proile"
        ></img>
        </div>

      </div>
      <div className="row justify-content-center " onSubmit={formik.handleSubmit}>
          <input {...ormi}className="text" style={{marginTop:10}}type="text" name="username" values={formik.values.username} placeholder="Username" ></input>

        </div>
        <div  className="row justify-content-center  ">
          <button  type='submit' style={{marginTop:10}} className="btn btn-success">Let's go</button>
        </div>
        <div className="row justify-content-center  ">
          <p>Not a member? <Link to="/register">Register now</Link></p>
        </div>
    </div>
  );
}
